import Header from "../ui/Header";
import { useAnime } from "../Context/AnimeContext";

function Layout() {
  const { currentPage, lastPage, totalItems, handlePageClick } = useAnime();
  return (
    <div className="container">
      <Header />
      <div className="anime">
        <Outlet />
      </div>
    </div>
  );
}

export default Layout;
